import './HomePage.css';
import Carousel from '../../components/Carousel/Carousel.js'

function HomePage() {

  const imageSrc = ["src/resources/images/banner2.jpg", "src/resources/images/banner3.jpg"]


  return (
    <>
        <div className='hej'>
          <Carousel imageSrc={imageSrc} />
